import React from 'react'

function Comment(props) {
    const commentWrapperStyle = {};
    const commentTopStyle ={
        display: 'flex'
    }

    return (
        <div>
            <div style = {commentTopStyle}>
                <p>Guest</p>
                {props.date}
            </div>
            <div>
                <p>{props.content}</p>
            </div>
        </div>
    )
}

export default Comment
